module.exports = "<section class=\"markdown\">\n    <p>一组默认可见的选项，可以进行多项选择。</p>\n    <h2>引入</h2>\n    <cherry-code>import &#123;CheckboxModule&#125; from '~/cherry-ui;</cherry-code>\n\n    <h2>基础用法</h2>\n    <p>普通状态和不可用状态</p>\n    <div class=\"cardBox\">\n        <cherry-card>\n            <div cherry-row [uiGutter]=\"16\">\n                <div cherry-col [uiSpan]=\"4\">\n                    <label cherry-checkbox [(ngModel)]=\"_checked\">\n                        <span>Checkbox</span>\n                    </label>\n                </div>\n                <div cherry-col [uiSpan]=\"4\">\n                    <label cherry-checkbox [uiDisabled]=\"true\" [ngModel]=\"_checked\">\n                        <span>不可用</span>\n                    </label>\n                </div>\n            </div>\n        </cherry-card>\n    </div>\n    <cherry-code [language]=\"html\">\n&lt;label cherry-checkbox [(ngModel)]=\"_checked\"&gt;\n    &lt;span>Checkbox&lt;/span&gt;\n&lt;label&gt;\n&lt;label cherry-checkbox [uiDisabled]=\"true\" [ngModel]=\"_checked\"&gt;\n    &lt;span>不可用&lt;/span&gt;\n&lt;/label&gt;\n    </cherry-code>\n    <h2>checkbox组</h2>\n    <p>checkbox-group组件，可从数组生成一组checkbox</p>\n    <div class=\"cardBox\">\n        <cherry-card>\n            <div cherry-row [uiGutter]=\"16\">\n                <div cherry-col [uiSpan]=\"12\">\n                    <cherry-checkbox-group [(ngModel)]=\"_checkgroups\"> </cherry-checkbox-group>\n                </div>\n            </div>\n        </cherry-card>\n    </div>\n    <cherry-code [language]=\"html\">\n&lt;cherry-checkbox-group [(ngModel)]=\"_checkgroups\"&gt; &lt;/cherry-checkbox-group&gt;\n    </cherry-code>\n    <h2>垂直排列</h2>\n    <p>将uiType设为vertical来让checkbox组垂直排列 </p>\n    <div class=\"cardBox\">\n        <cherry-card>\n            <div cherry-row [uiGutter]=\"16\">\n                <div cherry-col [uiSpan]=\"12\">\n                    <cherry-checkbox-group [(ngModel)]=\"_checkgroupsVertical\" [uiType]=\"'vertical'\"> </cherry-checkbox-group>\n                </div>\n            </div>\n        </cherry-card>\n    </div>\n    <cherry-code [language]=\"html\">\n&lt;cherry-checkbox-group [(ngModel)]=\"_checkgroupsVertical\" [uiType]=\"'vertical'\"&gt; &lt;/cherry-checkbox-group&gt;\n    </cherry-code>\n\n    <h2>中间状态</h2>\n    <p>使用uiIndeterminate来获得checkbox的中间状态（仅用于视觉反馈，如全选、半选的视觉区分） </p>\n    <div class=\"cardBox\">\n        <cherry-card>\n            <div cherry-row [uiGutter]=\"16\">\n                <div cherry-col [uiSpan]=\"4\">\n                    <label cherry-checkbox [(ngModel)]=\"allChecked\" (ngModelChange)=\"updateAllChecked()\" [uiIndeterminate]=\"indeterminate\">\n                        <span>{{allChecked ? 'All' : 'notAll'}}</span>\n                    </label>\n                </div>\n                <div cherry-col [uiSpan]=\"12\">\n                    <cherry-checkbox-group [(ngModel)]=\"_checkgroupsAll\" (ngModelChange)=\"updateSingleChecked()\"> </cherry-checkbox-group>\n                </div>\n            </div>\n        </cherry-card>\n    </div>\n    <cherry-code [language]=\"html\">\n&lt;label cherry-checkbox [(ngModel)]=\"allChecked\" (ngModelChange)=\"updateAllChecked()\" [uiIndeterminate]=\"indeterminate\"&gt;\n    &lt;span&gt;&#123;allChecked ? 'All' : 'notAll'&#125;&lt;/span&gt;\n&lt;/label&gt;\n&lt;cherry-checkbox-group [(ngModel)]=\"_checkgroupsAll\" (ngModelChange)=\"updateSingleChecked()\"&gt; &lt;/cherry-checkbox-group&gt;\n    </cherry-code>\n<cherry-code [language]=\"typescript\">\nallChecked = false;\nindeterminate = true;\nupdateAllChecked() &#123;\n    this.indeterminate = false;\n    if (this.allChecked) &#123;\n        this._checkgroupsAll.forEach(item => item.checked = true);\n    &#125;else &#123;\n        this._checkgroupsAll.forEach(item => item.checked = false);\n    &#125;\n&#125;\n\nupdateSingleChecked() &#123;\n    if (this._checkgroupsAll.every(item => item.checked === false)) &#123;\n        this.allChecked = false;\n        this.indeterminate = false;\n    &#125; else if (this._checkgroupsAll.every(item => item.checked === true)) &#123;\n        this.allChecked = true;\n        this.indeterminate = false;\n    &#125; else &#123;\n    this.indeterminate = true;\n    &#125;\n&#125;\n\n</cherry-code>\n    <h2>API</h2>\n    <h3>cherry-checkbox</h3>\n    <table>\n        <thead>\n            <tr>\n                <th>参数</th>\n                <th>说明</th>\n                <th>类型</th>\n                <th>默认值</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td>ngModel</td>\n                <td>指定当前是否选中，支持双向绑定</td>\n                <td>Boolean</td>\n                <td>-</td>\n            </tr>\n            <tr>\n                <td>uiDisabled</td>\n                <td>是否禁用多选框</td>\n                <td>Boolean</td>\n                <td>false</td>\n            </tr>\n            <tr>\n                <td>uiIndeterminate</td>\n                <td>半选状态</td>\n                <td>Boolean</td>\n                <td>false</td>\n            </tr>\n        </tbody>\n    </table>\n\n    <h3>cherry-checkbox-group</h3>\n    <table>\n        <thead>\n            <tr>\n                <th>参数</th>\n                <th>说明</th>\n                <th>类型</th>\n                <th>默认值</th>\n            </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <td>ngModel</td>\n                <td>选项数组，支持双向绑定</td>\n                <td>Array</td>\n                <td>-</td>\n            </tr>\n            <tr>\n                <td>uiDisabled</td>\n                <td>是否禁用多选框</td>\n                <td>Boolean</td>\n                <td>false</td>\n            </tr>\n            <tr>\n                <td>uiType</td>\n                <td>排列方式</td>\n                <td>'vertical'</td>\n                <td>-</td>\n            </tr>\n        </tbody>\n    </table>\n</section>\n"

