module.exports = "\n    <section class=\"markdown\">\n        <p>这部分包括文本输入框和文本域输入框,为用户提供输入的功能。我们的输入组件考虑了不同的输入情境,为不同的情境提供支持,并且使用这个输入组件你依然可以访问到底层的input标签。</p>\n        <h2>引入</h2>\n        <cherry-code>import &#123;InputModule&#125; from '~/cherry-ui;</cherry-code>\n\n        <h2>基础用法</h2>\n        <p>在input标签上添加cherry-input指令即可</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow\">\n                    <div cherry-col [uiSpan]=\"4\">\n                        <input cherry-input placeholder=\"正常状态\">\n                    </div>\n                    <div cherry-col [uiSpan]=\"4\">\n                        <input cherry-input placeholder=\"禁用状态\" [disabled]=\"true\">\n                    </div>\n                    <div cherry-col [uiSpan]=\"4\">\n                        <input cherry-input placeholder=\"只读状态\" [readonly]=\"true\">\n                    </div>\n                </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;input cherry-input placeholder=\"正常状态\"&gt;\n&lt;input cherry-input placeholder=\"禁用状态\" [disabled]=\"true\"&gt;\n&lt;input cherry-input placeholder=\"只读状态\" [readonly]=\"true\"&gt;\n\n            </cherry-code>\n        </section>\n\n        <h2>尺寸大小</h2>\n        <p>使用uiSize来使用尺寸不同的输入框</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow\">\n                    <div cherry-col [uiSpan]=\"4\">\n                        <input cherry-input placeholder=\"sm\" [uiSize]=\"'sm'\">\n                    </div>\n                    <div cherry-col [uiSpan]=\"4\">\n                        <input cherry-input placeholder=\"normal\">\n                    </div>\n                    <div cherry-col [uiSpan]=\"4\">\n                        <input cherry-input placeholder=\"lg\" [uiSize]=\"'lg'\">\n                    </div>\n                </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;input cherry-input placeholder=\"sm\" [uiSize]=\"'sm'\"&gt;\n&lt;input cherry-input placeholder=\"normal\"&gt;\n&lt;input cherry-input placeholder=\"lg\" [uiSize]=\"'lg'\"&gt;\n\n            </cherry-code>\n        </section>\n\n        <h2>文本域</h2>\n        <p>使用uiAutosize来让文本域可以自动变化高度 可以设置uiAotosize的最小行数和最大行数</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow \">\n                        <div cherry-col [uiSpan]=\"4\">\n                                <textarea cherry-input placeholder=\"我是一个普通的文本域\" rows=\"3\" cols=\"3\"></textarea>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <textarea cherry-input placeholder=\"我是一个自动变化高度的文本域\" [uiAutosize]=\"true\"></textarea>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <textarea cherry-input placeholder=\"我是最小行数为4，最大行数为6的自动变化高度的文本域\" [uiAutosize]=\"{minRows: 4, maxRows: 6}\" ></textarea>\n                            </div>\n                </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;textarea cherry-input placeholder=\"我是一个普通的文本域\" rows=\"3\" cols=\"3\"&gt;&lt;/textarea&gt;\n&lt;textarea cherry-input placeholder=\"我是一个自动变化高度的文本域\" [uiAutosize]=\"true\"&gt;&lt;/textarea&gt;\n&lt;textarea cherry-input placeholder=\"我是最小行数为4，最大行数为6的自动变化高度的文本域\" [uiAutosize]=\"&#123;minRows: 4, maxRows: 6&#125;\"&gt;&lt;/textarea&gt;\n\n            </cherry-code>\n        </section>\n\n        <h2>Group</h2>\n        <p>为了满足更丰富的输入框展现形式和组合方式而存在的输入框容器,使用cherry-input-group标签来使用group容器</p>\n\n        <h3>前置/后置标签组合</h3>\n        <p>使用ng-template来运用前置后置标签</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow \">\n                        <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group>\n                                    <ng-template #addOnBefore>http://</ng-template>\n                                    <input cherry-input placeholder=\"前置\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group>\n                                    <input cherry-input placeholder=\"后置\">\n                                    <ng-template #addOnAfter>.com</ng-template>\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"6\">\n                                <cherry-input-group>\n                                    <ng-template #addOnBefore>http://</ng-template>\n                                    <input cherry-input placeholder=\"前置/后置\">\n                                    <ng-template #addOnAfter>.com</ng-template>\n                                </cherry-input-group>\n                            </div>\n                    </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;cherry-input-group&gt;\n    &lt;ng-template #addOnBefore&gt;http://&lt;/ng-template&gt;\n    &lt;input cherry-input placeholder=\"前置\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group&gt;\n    &lt;input cherry-input placeholder=\"后置\"&gt;\n    &lt;ng-template #addOnAfter&gt;.com&lt;/ng-template&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group&gt;\n    &lt;ng-template #addOnBefore&gt;http://&lt;/ng-template&gt;\n    &lt;input cherry-input placeholder=\"前置/后置\"&gt;\n    &lt;ng-template #addOnAfter&gt;.com&lt;/ng-template&gt;\n&lt;/cherry-input-group&gt;\n            </cherry-code>\n        </section>\n\n        <h3>前缀/后缀标签组合</h3>\n        <p>在输入框内加入前缀后缀标签</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow \">\n                        <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group>\n                                    <ng-template #prefix>\n                                        <i class=\"fa fa-user\"></i>\n                                    </ng-template>\n                                    <input cherry-input placeholder=\"前缀\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group>\n                                    <ng-template #suffix>\n                                        <i class=\"fa fa-bar-chart\"></i>\n                                    </ng-template>\n                                    <input cherry-input placeholder=\"后缀\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group>\n                                    <ng-template #prefix>\n                                        <i class=\"fa fa-user\"></i>\n                                    </ng-template>\n                                    <input cherry-input placeholder=\"前缀/后缀\">\n                                    <ng-template #suffix>\n                                        <i class=\"fa fa-bar-chart\"></i>\n                                    </ng-template>\n                                </cherry-input-group>\n                            </div>\n                    </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;cherry-input-group&gt;\n    &lt;ng-template #prefix&gt;\n        &lt;i class=\"fa fa-user\"&gt; &lt;/i&gt;\n    &lt;/ng-template&gt;\n    &lt;input cherry-input placeholder=\"前缀\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group&gt;\n    &lt;input cherry-input placeholder=\"后缀\"&gt;\n    &lt;ng-template #suffix&gt;\n        &lt;i class=\"fa fa-chart\"&gt; &lt;/i&gt;\n    &lt;/ng-template&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group&gt;\n    &lt;ng-template #prefix&gt;\n        &lt;i class=\"fa fa-user\"&gt; &lt;/i&gt;\n    &lt;/ng-template&gt;\n    &lt;input cherry-input placeholder=\"前缀后缀\"&gt;\n    &lt;ng-template #suffix&gt;\n        &lt;i class=\"fa fa-chart\"&gt; &lt;/i&gt;\n    &lt;/ng-template&gt;\n&lt;/cherry-input-group&gt;\n            </cherry-code>\n        </section>\n\n        <h3>输入框组合</h3>\n        <p>使用uiCompact来把输入框进行紧密的组合</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow \">\n                        <div cherry-col [uiSpan]=\"6\">\n                                <cherry-input-group>\n                                    <div cherry-col [uiSpan]=\"8\">\n                                        <input cherry-input placeholder=\"name\">\n                                    </div>\n                                    <div cherry-col [uiSpan]=\"8\">\n                                        <input cherry-input placeholder=\"name2\">\n                                    </div>\n                                    <div cherry-col [uiSpan]=\"8\">\n                                        <input cherry-input placeholder=\"name2\">\n                                    </div>\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"6\">\n                                <cherry-input-group [uiCompact]=\"true\">\n                                        <input cherry-input placeholder=\"name\" style=\"width:30%\">\n                                        <input cherry-input placeholder=\"name2\" style=\"width:30%\">\n                                        <input cherry-input placeholder=\"name3\" style=\"width:30%\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"6\">\n                                    <cherry-input-group [uiCompact]=\"true\" >\n                                            <input cherry-input placeholder=\"起\" style=\"width: 80px; text-align: center;\">\n                                            <input cherry-input placeholder=\"~\" style=\"width: 30px; border-left: 0px; pointer-events: none;\">\n                                            <input cherry-input placeholder=\"止\" style=\"width: 80px; text-align: center; border-left: 0px;\">\n                                    </cherry-input-group>\n                                </div>\n                    </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;cherry-input-group&gt;\n    &lt;div cherry-col [uiSpan]=\"8\"&gt;\n        &lt;input cherry-input placeholder=\"name\"&gt;\n    &lt;/div&gt;\n    &lt;div cherry-col [uiSpan]=\"8\"&gt;\n        &lt;input cherry-input placeholder=\"name\"&gt;\n    &lt;/div&gt;\n    &lt;div cherry-col [uiSpan]=\"8\"&gt;\n        &lt;input cherry-input placeholder=\"name\"&gt;\n    &lt;/div&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group  [uiCompact]=\"true\"&gt;\n    &lt;input cherry-input placeholder=\"name\"  style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name2\" style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name3\" style=\"width:30%\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group  [uiCompact]=\"true\"&gt;\n    &lt;input cherry-input placeholder=\"起\" style=\"width: 80px; text-align: center;\"&gt;\n    &lt;input cherry-input placeholder=\"~\" style=\"width: 30px; border-left: 0px; pointer-events: none;\"&gt;\n    &lt;input cherry-input placeholder=\"止\" style=\"width: 80px; text-align: center; border-left: 0px;\"&gt;\n&lt;/cherry-input-group&gt;\n            </cherry-code>\n        </section>\n\n        <h3>输入框组合尺寸大小</h3>\n        <p>使用uiSize来控制输入框组合的尺寸</p>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow \">\n                        <div cherry-col [uiSpan]=\"6\">\n                                <cherry-input-group [uiCompact]=\"true\" [uiSize]=\"'sm'\">\n                                        <input cherry-input placeholder=\"sm\" style=\"width:30%\">\n                                        <input cherry-input placeholder=\"sm\" style=\"width:30%\">\n                                        <input cherry-input placeholder=\"sm\" style=\"width:30%\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"6\">\n                                <cherry-input-group [uiCompact]=\"true\">\n                                        <input cherry-input placeholder=\"normal\" style=\"width:30%\">\n                                        <input cherry-input placeholder=\"normal\" style=\"width:30%\">\n                                        <input cherry-input placeholder=\"normal\" style=\"width:30%\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"6\">\n                                    <cherry-input-group [uiCompact]=\"true\" [uiSize]=\"'lg'\">\n                                            <input cherry-input placeholder=\"lg\" style=\"width:30%\">\n                                            <input cherry-input placeholder=\"lg\" style=\"width:30%\">\n                                            <input cherry-input placeholder=\"lg\" style=\"width:30%\">\n                                    </cherry-input-group>\n                                </div>\n                    </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;cherry-input-group  [uiCompact]=\"true\" [uiSize]=\"'sm'\"&gt;\n    &lt;input cherry-input placeholder=\"name\"  style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name2\" style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name3\" style=\"width:30%\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group  [uiCompact]=\"true\"&gt;\n    &lt;input cherry-input placeholder=\"name\"  style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name2\" style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name3\" style=\"width:30%\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group  [uiCompact]=\"true\" [uiSize]=\"'lg'\"&gt;\n    &lt;input cherry-input placeholder=\"name\"  style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name2\" style=\"width:30%\"&gt;\n    &lt;input cherry-input placeholder=\"name3\" style=\"width:30%\"&gt;\n&lt;/cherry-input-group&gt;\n            </cherry-code>\n        </section>\n\n        <h3>线型输入框</h3>\n        <p>使用uiLine来运用一个视觉上更简洁的输入框</p>\n        <blockquote>线型输入框中除了Input元素外还包括其他元素,所以需要group容器进行封装</blockquote>\n        <div class=\"cardBox\">\n            <cherry-card>\n                <div cherry-row  [uiGutter]=\"16\" class=\"demorow \">\n                        <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group [uiLine]=\"true\">\n                                    <input cherry-input placeholder=\"normal\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group [uiLine]=\"true\">\n                                    <input cherry-input placeholder=\"禁用\" [disabled]=\"true\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group [uiLine]=\"true\">\n                                    <input cherry-input placeholder=\"只读\" [readonly]=\"true\">\n                                </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group [uiLine]=\"true\">\n                                    <ng-template #prefix>\n                                        <i class=\"fa fa-user\"></i>\n                                    </ng-template>\n                                    <input cherry-input placeholder=\"前缀/后缀\">\n                                    <ng-template #suffix>\n                                        <i class=\"fa fa-bar-chart\"></i>\n                                    </ng-template>\n                                </cherry-input-group>\n                            </div>\n                    </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;cherry-input-group [uiLine]=\"true\"&gt;\n        &lt;input cherry-input placeholder=\"normal\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group [uiLine]=\"true\"&gt;\n    &lt;cherry-input placeholder=\"禁用\" [disabled]=\"true\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group [uiLine]=\"true\"&gt;\n    &lt;input cherry-input placeholder=\"只读\" [readonly]=\"true\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group [uiLine]=\"true\"&gt;\n    &lt;ng-template #prefix&gt;\n        &lt;i class=\"fa fa-user\"&gt; &lt;/i&gt;\n    &lt;/ng-template&gt;\n    &lt;input cherry-input placeholder=\"前缀后缀\"&gt;\n    &lt;ng-template #suffix&gt;\n        &lt;i class=\"fa fa-chart\"&gt; &lt;/i&gt;\n    &lt;/ng-template&gt;\n&lt;/cherry-input-group&gt;\n            </cherry-code>\n        </section>\n\n        <h3>输入框文本组合</h3>\n        <p>提供垂直,flex两种文本展现方式,输入框获得焦点时,文本也能够和输入框一起获得焦点,uiLabel用来传入文本,uiLabelType可以选择展现方式</p>\n        <blockquote>使用时把组件的父元素的position设为relative</blockquote>\n        <div class=\"cardBox\">\n            <cherry-card>\n                    <div cherry-row  [uiGutter]=\"16\" class=\"demorow\">\n                            <div cherry-col [uiSpan]=\"4\">\n                                    <cherry-input-group [uiLabel]=\"'垂直'\" [uiLabelType]=\"'row'\">\n                                        <input cherry-input placeholder=\"row\">\n                                    </cherry-input-group>\n                            </div>\n                            <div cherry-col [uiSpan]=\"4\">\n                                <cherry-input-group [uiLine]=\"true\" [uiLabel]=\"'垂直'\" [uiLabelType]=\"'row'\">\n                                    <input cherry-input placeholder=\"row\">\n                                </cherry-input-group>\n                            </div>\n                        </div>\n<!--\n                        <div cherry-row  [uiGutter]=\"16\" class=\"demorow\">\n                                <div cherry-col [uiSpan]=\"6\">\n                                        <cherry-input-group [uiLabel]=\"'水平'\" [uiLabelType]=\"'col'\">\n                                            <input cherry-input placeholder=\"col\">\n                                        </cherry-input-group>\n                                </div>\n                                <div cherry-col [uiSpan]=\"6\">\n                                    <cherry-input-group [uiLine]=\"true\" [uiLabel]=\"'水平'\" [uiLabelType]=\"'col'\">\n                                        <input cherry-input placeholder=\"col\">\n                                    </cherry-input-group>\n                                </div>\n                            </div> -->\n\n                            <div cherry-row  [uiGutter]=\"16\" class=\"demorow\">\n                                    <div cherry-col [uiSpan]=\"4\">\n                                            <cherry-input-group  [uiLabel]=\"'flex'\" [uiLabelType]=\"'flex'\">\n                                                <input cherry-input placeholder=\"flex \">\n                                            </cherry-input-group>\n                                    </div>\n                                    <div cherry-col [uiSpan]=\"4\">\n                                        <cherry-input-group [uiLine]=\"true\" [uiLabel]=\"'flex'\" [uiLabelType]=\"'flex'\">\n                                            <input cherry-input placeholder=\"flex\">\n                                        </cherry-input-group>\n                                    </div>\n\n                                </div>\n            </cherry-card>\n        </div>\n        <section>\n            <cherry-code [language]=\"html\">\n&lt;cherry-input-group [uiLabel]=\"'垂直'\" [uiLabelType]=\"'row'\"&gt;\n        &lt;input cherry-input placeholder=\"row\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group [uiLine]=\"true\" [uiLabel]=\"'垂直'\" [uiLabelType]=\"'row'\"&gt;\n        &lt;input cherry-input placeholder=\"row\"&gt;\n&lt;/cherry-input-group&gt;\n<!--\n&lt;cherry-input-group [uiLabel]=\"'水平'\" [uiLabelType]=\"'col'\"&gt;\n        &lt;input cherry-input placeholder=\"col\" style=\"width:80%\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group [uiLine]=\"true\" [uiLabel]=\"'水平'\" [uiLabelType]=\"'col'\"&gt;\n        &lt;input cherry-input placeholder=\"col\" style=\"width:80%\"&gt;\n&lt;/cherry-input-group&gt; -->\n\n&lt;cherry-input-group [uiLabel]=\"'flex'\" [uiLabelType]=\"'flex'\"&gt;\n        &lt;input cherry-input placeholder=\"flex\"&gt;\n&lt;/cherry-input-group&gt;\n\n&lt;cherry-input-group [uiLine]=\"true\" [uiLabel]=\"'flex'\" [uiLabelType]=\"'flex'\"&gt;\n        &lt;input cherry-input placeholder=\"flex\"&gt;\n&lt;/cherry-input-group&gt;\n            </cherry-code>\n        </section>\n\n        <h2>API</h2>\n        <h3>cherry-input</h3>\n        <table>\n                <thead>\n                  <tr>\n                    <th>参数</th>\n                    <th>说明</th>\n                    <th>类型</th>\n                    <th>默认值</th>\n                  </tr>\n                </thead>\n                <tbody>\n                    <tr>\n                    <td>uiSize</td>\n                    <td>可设置输入框的大小</td>\n                    <td>String</td>\n                    <td>-</td>\n                  </tr>\n                  <tr>\n                    <td>uiAutosize</td>\n                    <td>textarea的特有Api</td>\n                    <td>boolean|object</td>\n                    <td>false</td>\n                  </tr>\n                </tbody>\n              </table>\n\n              <h3>cherry-input-group</h3>\n              <table>\n                      <thead>\n                        <tr>\n                          <th>参数</th>\n                          <th>说明</th>\n                          <th>类型</th>\n                          <th>默认值</th>\n                        </tr>\n                      </thead>\n                      <tbody>\n                          <tr>\n                          <td>#addOnBefore</td>\n                          <td>设置前置标签</td>\n                          <td>ng-template</td>\n                          <td>-</td>\n                        </tr>\n                        <tr>\n                          <td>#addonAfter</td>\n                          <td>设置后置标签</td>\n                          <td>ng-template</td>\n                          <td>-</td>\n                        </tr>\n                        <tr>\n                          <td>#prefix</td>\n                          <td>设置前缀标签</td>\n                          <td>ng-template</td>\n                          <td>-</td>\n                        </tr>\n                        <tr>\n                          <td>#suffix</td>\n                          <td>设置后缀标签</td>\n                          <td>ng-template</td>\n                          <td>-</td>\n                        </tr>\n                        <tr>\n                          <td>uiCompact</td>\n                          <td>设置组合方式为紧密型</td>\n                          <td>boolean</td>\n                          <td>false</td>\n                        </tr>\n                        <tr>\n                          <td>uiSize</td>\n                          <td>设置组合的大小</td>\n                          <td>string</td>\n                          <td>-</td>\n                        </tr>\n                        <tr>\n                          <td>uiLine</td>\n                          <td>设置输入框为线型</td>\n                          <td>boolean</td>\n                          <td>false</td>\n                        </tr>\n                        <tr>\n                          <td>uiLabel</td>\n                          <td>设置输入框文本标签</td>\n                          <td>string</td>\n                          <td>-</td>\n                        </tr>\n                        <tr>\n                          <td>uiLabelType</td>\n                          <td>设置输入框文本标签类型</td>\n                          <td>string</td>\n                          <td>-</td>\n                        </tr>\n                      </tbody>\n                    </table>\n    </section>\n\n\n"

